  namespace: SuperOffice.WebApi.Data
  summary: "\nCarrier object for ProjectEntity.\nThe Project Service. The service implements all services working with the Project object    \n"
  remarks: >
    Use <xref href="SuperOffice.CRM.Services.ArchiveAgent" data-throw-if-not-resolved="false"></xref>:

    All ProjectEntity: <pre><code>&quot;FindProject&quot;</code></pre>

    Activities: <pre><code>&quot;ProjectActivity&quot;</code></pre> with restriction <pre><code>&quot;projectId eq &quot; + id</code></pre>.

    Guide: <pre><code>&quot;ProjectGuide&quot;</code></pre> with restriction <pre><code>&quot;projectId eq &quot; + id</code></pre>.

    Members: <pre><code>&quot;ProjectMember&quot;</code></pre> with restriction <pre><code>&quot;projectId eq &quot; + id</code></pre>.

    Contacts: <pre><code>&quot;ContactProjects&quot;</code></pre> with restriction <pre><code>&quot;projectId eq &quot; + id</code></pre>.

    Links: <pre><code>&quot;Links&quot;</code></pre> with restriction <pre><code>&quot;sourceProjectRestrictionId eq &quot; + id</code></pre>.
  example:
  - "\nGet ProjectEntity 123 using the WebApi client:\n<pre><code>var configuration = new WebApiConfiguration(url);\nvar agent = new ProjectAgent(configuration);\nvar projectEntity = agent.GetProjectEntity( 123 );</code></pre>\n"
